import "./App.css";
import FaceIcon from "./face-icon.svg"

function App() {
  return (
    <div className="pageWrap">
      <img src={FaceIcon} alt="React Logo" id="faceIcon"/>
      <div className="title">
        Hi, my <br></br>
        name is <span style={{ fontWeight: "800" }}>Khushi!</span>
      </div>
      <div className="subText">
        I'm a second-year{" "}
        <span style={{ fontWeight: "800" }}>Software-Engineering student</span> at
        the University of Waterloo.
      </div>
    </div>
  );
}

export default App;
